        onChange={handleChange}
      />
        </label>
        <label>Enter your Family name:
        <input 
          type="number" 
          name="age" 
          value={inputs.age || ""} 
          onChange={handleChange}
        />
        </label>
        <input type="submit" />
    </form>


  )
  }

